    int minOperations(vector<int>& nums) {
        int res = 0, maxi = 1;
        for (int a : nums) {
            int count = 0;
            while (a > 0) {
                res += a & 1;
                count++;
                a >>= 1;
            }
            maxi = max(maxi, count);
        }
        return res + maxi - 1;
    }

